import React from "react";
import MyButton from "../UI/button/MyButton";
import "../styles/PostItem.css";

const PostItem = () => {
  return (
    <div className="post">
      <div className="post__content">
        <strong>1. JS</strong>
        <div>Description</div>
      </div>
      <div className="post__btns">
        <MyButton disabled>Delete</MyButton>
      </div>
    </div>
  );
};

export default PostItem;
